import { Component } from "react";
import Title from "./Title";
import './App.css';

class Signup extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="signup">
                <Title text="SignUp"/>
                <input />
            </div>
        );
    }
}

export default Signup;
